	for (var state in ya) {
		//分省区域着色
		
		
		if(ya[state]['hasPrize']){
			ya[state]['path'].attr({"fill":"#f48029"});
		}
		if(ya[state]['text']){
			ya[state]['text'].toFront();
		}
		if(ya[state]['img']){
			ya[state]['img'].toFront();
		}
		//china[state]['path'].color = Raphael.getColor(0.9);
		(function (st,state) {
			
			$(st[0]).attr("transform","matrix(1.1,0,0,1.5,-520,50)");
			//$(st[0]).attr("transform","matrix(1,0,0,1,-200,1)");
			//$(text[0]).attr("transform","matrix(1.6,0,0,1.49,50.839,50.738)");
		
			if(ya[state].hasPrize){
			
				$(st[0]).css('cursor','pointer');
				$(st[0]).hover(function(e){
					//mark Province
					current && ya[current]['path'].animate({fill: ya[current].hasPrize?"#f48029":"#825223"}, 500); 
					st.animate({fill: "#73af1e"}, 500);
					current = state;
				},
				function(){
					current && ya[current]['path'].animate({fill: ya[current].hasPrize?"#f48029":"#825223"}, 500); 
				}).bind("click",function(){
					$(this).showWBtip({"left":ya[state].x-275+110,"top":ya[state].y-125+20});
				})				
								
			}
			
		})(ya[state]['path'],state);
	}
